import Users from "./public/users.json";

const Grid = () => {
  return (
    <div className="grid grid-cols-3 md:grid-cols-1 lg:grid-cols-3 gap-6">
      <Card title="P1" imgSrc="" imgAlt="PP1" id="1"></Card>
      <Card title="P2" imgSrc="" imgAlt="PP2" id="2"></Card>
      <Card title="P3" imgSrc="" imgAlt="PP3" id="3"></Card>
      <Card title="P4" imgSrc="" imgAlt="PP4" id="4"></Card>
      <Card title="P5" imgSrc="" imgAlt="PP5" id="5"></Card>
      <Card title="P6" imgSrc="" imgAlt="PP6" id="6"></Card>
    </div>
  );
};

export default Grid;
